import { productsState } from "./state";
import { NEW_PRODUCT } from "./type";

export const productReducer = (state=productsState, action)=>{
    switch(action.type){
        case NEW_PRODUCT:
            state.products.push()
        default:
            break
    }

    
    return {...state}
}
